import { Fragment, useEffect, useState } from 'react';
import '../SignUpAsMaster/SignUpAsMaster.css';
import MasterFIOEnter from "./phases/FIOEnter";
import MasterOccupationEnter from "./phases/OccupationEnter";
import MasterLocationEnter from "./phases/LocationEnter";
import MasterEmailEnter from "./phases/EmailEnter";
import MasterPhotoEnter from "./phases/PhotoEnter";

const comps = [<MasterFIOEnter></MasterFIOEnter>, 
                <MasterOccupationEnter></MasterOccupationEnter>,
                <MasterLocationEnter></MasterLocationEnter>, 
                <MasterEmailEnter></MasterEmailEnter>, 
                <MasterPhotoEnter></MasterPhotoEnter>]

const SignUpMaster = () => {

    const [step, setStep] = useState(0);

    useEffect(() => {

    }, [comps, step]);

    const move = (incr) => {
        const ntStep = step + incr;
        if(ntStep >= 0 && ntStep <= 4){
            setStep(ntStep);
        }
    }

    return(<Fragment>
        {comps[step]}
        <button onClick={move(1)}>back</button>
        <button onClick={move(-1)}>next</button>
    </Fragment>);
};

export default SignUpMaster;
